import './Hero.css';

const Hero = () => (
    <div className="hero__left">
        <h1>Hello, I'm Vladislav Pinteac</h1>
        <p>As a new web developer, I'm driven by energy and desire to create great projects. I'm passionate about 
           web development, constantly learning and exploring new technologies. My goal is to build innovative, user-friendly websites
           that deliver engaging experiences.</p>
         <a href="mailto:vpinteac@gmail.com"><button type="button">Email me</button></a>
    </div>
);

export default Hero;
